import React from 'react';
import './Experience.css';
import CVEntry from './CVEntry';

function Experience() {
  const experiences = [
    {
      title: 'Frontend Developer',
      location: 'Company XYZ, New York, NY',
      dates: 'June 2020 - Present',
      responsibilities: [
        'Developed user-friendly web pages using React.',
        'Collaborated with designers to create responsive designs.',
        'Optimized web applications for maximum speed.',
      ],
    },
    {
      title: 'Web Designer',
      businessName: 'Company ABC, San Francisco, CA',
      dates: 'January 2018 - May 2020',
      responsibilities: [
        'Designed and implemented web layouts using HTML, CSS, and JavaScript.',
        'Ensured cross-browser compatibility.',
        'Worked with backend developers to integrate APIs.',
      ],
    },
  ];

  return (
    <div className='experience-container'>
      <h1>Daniel Davies</h1>
      <h2>
        <mark style={{ backgroundColor: '#3498db' }}>Web Development</mark> |{' '}
        <mark style={{ backgroundColor: '#1abc9c' }}>Digital Content</mark>
      </h2>
      <div className='experience-email'>
        <i className='fa-solid fa-envelope' style={{ color: 'black' }}></i>
        <p>E-Mail: danieldavies2203@gmail.com</p>
      </div>
      <div className='experience-phone'>
        <i className='fa-solid fa-phone' style={{ color: 'black' }}></i>
        <p>Phone Number: 07383560716</p>
      </div>
      {experiences.map((experience, index) => (
        <CVEntry
          key={index}
          title={experience.title}
          businessName={experience.businessName}
          dates={experience.dates}
          responsibilities={experience.responsibilities}
        />
      ))}
    </div>
  );
}

export default Experience;
